Brian Eno - Ambient Collection.

Soothing music from Brian Eno, released in the 70s and 80s, these songs are timeless. They are all very quiet, good for background music for studying, working, sleeping, or other such things. All songs are MP3, and vary between 192 and 320kbps as I received them over time. Most are 220ish VBR. 

